import React from "react";

export default function TodoList({
  todos,
  deleteTodo,
  completeTodo,
}) {
  return todos.length > 0 ? (
    <ul>
      {todos.map((todo, index) => (
        <div class="todo-container">
          <li key={index}>{todo}+{index}</li>
          <div>
            <button class="complete-btn" onClick={completeTodo}>
              <i class="fas fa-check">Complete</i>
              
            </button>
            <button class="trash-btn" onClick={() => deleteTodo(index)}>
                <i class="fa-regular fa-trash"></i>
            </button>
          </div>
        </div>
      ))}
    </ul>
  ) : (
    <ul>
      <li>No todos</li>
    </ul>
  );
}
